import { createAction } from '@reduxjs/toolkit';

const dataloaded = createAction("DATA_LOADED")

const initialState={
    userinfo:[]
}

function reducer(state=initialState,action){
    switch (action.type) {
        case dataloaded:
            return { ...state, userinfo: state.userinfo}
        default:
            return state
    }
  
}
export default reducer;
